"(1) בית
משפט פסק כי ראיה מהראיות שהובאו באותו ענין יסודה היה בשקר או בזיוף, ויש יסוד להניח
כי אילולא ראיה זאת היה בכך כדי לשנות את תוצאות המשפט לטובת הנידון;

(2)   הוצגו
עובדות או ראיות, העשויות, לבדן או ביחד עם החומר שהיה בפני בית המשפט בראשונה, לשנות
את תוצאות המשפט לטובת הנידון;

(3)   אדם
אחר הורשע בינתיים בביצוע אותו מעשה העבירה, ומהנסיבות שנתגלו במשפטו של אותו אדם אחר
נראה כי מי שהורשע לראשונה בעבירה לא ביצע אותה;
